import { getAllUsers } from "./DATA";
import { useDispatch } from "react-redux";
import { loadUsers } from "./actions"; // it take user return type +users
//import { useSelector } from 'react-redux'; //Added


function App() {
  // if user is login

  const dispatch = useDispatch();
  //getAllUsers().then(users =>console.log(users))
  getAllUsers().then((users) => dispatch(loadUsers(users)));
  //return <div className="App">Choose one App</div>;
  //const users = useSelector(state => state.users);//Added


  return (



    <div className="container" align="center">
        <div className="center">
          <h1>The login screen</h1>
          <p>The select username is used to select a username to login.</p>
          <form action="/action_page.php">
            <label htmlFor="usersnames">Choose a username:</label>
            <select >
              <option >{users}</option>
              <option >Saab</option>
              <option >Opel</option>
              <option >Audi</option>
            </select>


            <br /><br />
            <input type="submit" defaultValue="Submit" />
          </form>
        </div>
      </div>
  );
}

export default App;
